def LeftorRight(mutNumber):
    if mutNumber == "N/A":
        return "N/A"
    mutNumber = int(mutNumber)
    PossiblePeptides = PeptidesFunc(mutNumber)
    LowerBound = 0
    UpperBound = 0
    Right = 0
    Left = 0
    for peptide in PossiblePeptides:
        LowerBound = PossiblePeptides[peptide][0]
        UpperBound = PossiblePeptides[peptide][1]
        PeptideLength = UpperBound-LowerBound
        if PeptideLength == 8:
            if mutNumber < 5+LowerBound:
                Left += 1
            elif mutNumber >= 5+LowerBound:
                Right += 1
        if PeptideLength == 9:
            if mutNumber < 5+LowerBound:
                Left += 1
            elif mutNumber > 5+LowerBound:
                Right += 1
        if PeptideLength == 10:
            if mutNumber < 6+LowerBound:
                Left += 1
            elif mutNumber >= 6+LowerBound:
                Right += 1
    
    if Right != 0 and Left == 0:
        return "Right"
    elif Left != 0 and Right == 0:
        return "Left"
    elif Right != 0  and Left != 0:
        return "Both"
    elif Right == 0 and Left == 0:
        return "N/A"
    else:
        print("blank")

def ComplimentaryFunction(CDR3,Mutation):
    '''A positive value denotes a complementary score'''
    
    NCPR = CalculateNCPR(CDR3)
    AA_Charge_ = get_AA_charge(Mutation[0])-get_AA_charge(Mutation[len(Mutation)-1])
    NCPR_CS = AA_Charge_ * NCPR * -1
    if NCPR_CS > 0:
        return True
    else:
        return False
